import styled from "styled-components";

const AppWrapper = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

const ContentWrapper = styled.div`
  display: flex;
  justify-content: center;
  background-color: #f9dd74;
`;

export { AppWrapper, ContentWrapper };
